      out.write("<script>\r\n");
      out.write("function formatDate(date) {\r\n");
      out.write("    var year = date.getFullYear();\r\n");
      out.write("    var month = (\"0\" + (date.getMonth() + 1)).slice(-2); // Months are zero based. Add leading 0, slice last 2 chars\r\n");
      out.write("    var day = (\"0\" + date.getDate()).slice(-2);\r\n");
      out.write("    var hour = (\"0\" + date.getHours()).slice(-2);\r\n");
      out.write("    var minute = (\"0\" + date.getMinutes()).slice(-2);\r\n");
      out.write("    var second = (\"0\" + date.getSeconds()).slice(-2);\r\n");
      out.write("\r\n");
      out.write("    return year + \"-\" + month + \"-\" + day + \" \" + hour + \":\" + minute + \":\" + second;\r\n");
      out.write("}\r\n");
      out.write("   // 오늘이후 날짜선택막기, 선택이전날짜막기\r\n");
      out.write("   window.onload = function() {\r\n");
