      out.write("         endDateInput.setAttribute(\"min\", startDateInput.value);\r\n");
      out.write("      };\r\n");
      out.write("\r\n");
      out.write("   };\r\n");
      out.write("\r\n");
      out.write("   // 전역변수정의\r\n");
      out.write("var totalData; //총 데이터 수\r\n");
