      out.write("function displayData(currentPage, dataPerPage) {\r\n");
      out.write("	    let tableHtml = \"\";\r\n");
      out.write("	    currentPage = Number(currentPage);\r\n");
      out.write("	    dataPerPage = Number(dataPerPage);\r\n");
      out.write("    \r\n");
      out.write("	    \r\n");
      out.write("	    if (totalData < (currentPage - 1) * dataPerPage + dataPerPage){\r\n");
      out.write("\r\n");
      out.write("    	for (\r\n");
      out.write("    		var i = (currentPage - 1) * dataPerPage;\r\n");
      out.write("    		    i < totalData;\r\n");
      out.write("    			     i++\r\n");
      out.write("    		) {\r\n");
      out.write("        tableHtml += '<tr><td class=\"tdCenter1\">' + (dataList[i].point_time ? formatDate(new Date(dataList[i].point_time)) : \"\") \r\n");
      out.write("                     + '</td><td class=\"tdCenter1\">' + (dataList[i].point_history) \r\n");
      out.write("                     + '</td><td class=\"tdCenter1\">' + (dataList[i].point_price).toLocaleString() + \"</td></tr>\";\r\n");
      out.write("    					}\r\n");
      out.write("	}else{ \r\n");
      out.write("	  \r\n");
      out.write("	  for (\r\n");
      out.write("	    var i = (currentPage - 1) * dataPerPage;\r\n");
      out.write("	    i < (currentPage - 1) * dataPerPage + dataPerPage;\r\n");
